import ReadMoreReadLess from "./ReadMore";
export default function Project(props) {
    const longText = props.text
    return (
        <div class="w-1/3 h-80 bg-[#272b33] rounded-md">
            <img class="h-2/3 rounded-tr-md rounded-tl-md w-auto" alt={props.alt} src={props.img}/>
            <h2 class="font-bold text-2xl">{props.title}</h2>
            <p>{props.desc}</p>
            <ReadMoreReadLess text={longText} maxLength={300} />
        </div>
    );
}
